import React from 'react';
import { View } from 'react-native';
import { Icon, Footer as NativeBaseFooter, FooterTab, Button } from 'react-native-elements';

const Footer = () => {
  return (
    <NativeBaseFooter>
      <FooterTab>
        <Button
          type="clear"
          icon={<Icon name="home" type="font-awesome" color="white" />}
          title="Home"
        />
        <Button
          type="clear"
          icon={<Icon name="comments" type="font-awesome" color="white" />}
          title="Chat"
        />
        <Button
          type="clear"
          icon={<Icon name="user" type="font-awesome" color="white" />}
          title="Profile"
        />
      </FooterTab>
    </NativeBaseFooter>
  );
};

export default FooterScreen;
